import React from 'react';

// mataerial ui packages
import { Container } from '@material-ui/core';

//packages
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { Navigate } from "react-router-dom";

// component
import Navbar from './components/Navbar/Navbar';
import Home from './components/Home/Home';
import PostsDetails from './components/PostsDetail/PostsDetails';
import Auth from './components/Auth/Auth';

export const App = () => {
  const user  = JSON.parse(localStorage.getItem('peofile'));
  return (
    <BrowserRouter>
      <Container maxWidth="xl">
        <Navbar />
        <Routes>
          <Route path='/' exact element={() => <Navigate to="/posts" replace={true} />} />
          <Route path='/posts' exact element={<Home />} />
          <Route path='/posts/search' exact element={<Home />} />
          <Route path='/posts/:id' exact element={<PostsDetails />} />
          <Route path='/auth' exact element={() => !user ? <Auth /> : <Navigate to='/posts' replace={true} />} />
        </Routes>
      </Container>
    </BrowserRouter>
  )
};
